DROP TABLE IF EXISTS `city`;
CREATE TABLE `city`  (
  `Location_ID` int NOT NULL,
  `Location_Name_EN` varchar(255) DEFAULT NULL,
  `Location_Name_ZH` varchar(255) DEFAULT NULL,
  `ISO_3166_1` varchar(255) DEFAULT NULL,
  `Country_Region_EN` varchar(255) DEFAULT NULL,
  `Country_Region_ZH` varchar(255) DEFAULT NULL,
  `Adm1_Name_EN` varchar(255) DEFAULT NULL,
  `Adm1_Name_ZH` varchar(255) DEFAULT NULL,
  `Adm2_Name_EN` varchar(255) DEFAULT NULL,
  `Adm2_Name_ZH` varchar(255) DEFAULT NULL,
  `Timezone` varchar(255) DEFAULT NULL,
  `Latitude` double  DEFAULT NULL,
  `Longitude` double  DEFAULT NULL,
  `AD_code` int DEFAULT NULL,
  PRIMARY KEY (`Location_ID`)
);

